INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(1, 'Pimienta', '145.70', , 'El aroma del anís seco y picado es fresco, y el sabor está entre el del hinojo y la menta. Debido a que su sabor es muy persistente (y no a todos apetece), es mejor usarlo con moderación.');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(2, 'Cardamomo', '106.27', , 'Una de las especias más utilizadas en la medicina Ayurveda india para tratar una serie de enfermedades, como las que afectan las vías respiratorias. En la cocina, se puede usar en tés y es fundamental para preparar el Garam Masala, una combinación especial de especias.');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(5, 'Canela', '179.99', , 'Se utiliza, en particular, para postres y en el chocolate, aunque en la tradición oriental, esta especia se usa también en carnes y para la preparación del curry.');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(6, 'Orégano', '139.99', , 'Sus hojas frescas formaron parte del alcoholaturo vulnerario, preparado usado para curar heridas y la droga seca fue una de las especies cicatrizantes');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(7, 'Pimentón', '119.80', , 'Se le atribuyen propiedades beneficiosas y se dice que tiene poder antiséptico, desinfectante y tónico y que ayuda la digestión. En la cocina, es infaltable en el gulash húngaro (que lleva al menos un bote entero), y es la base de las mezclas cajún y adobo, esta última típica de Sudamérica. Probadlo también solo sobre chips de verduras o para darle un toque especial a unas pechugas de pollo.');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(8, 'Comino', '115.80', , 'Tiene sabor dulce, que a menudo se asocia con la comida india, pero puede utilizarse también en sopas, en fondos de carne, licores y legumbres.');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(9, 'Jengibre', '194.80', , 'Se consigue en forma de especia o fresco (raíz), es un aliado para primeros platos, platos de pescado y recetas étnicas. La combinación con calabaza, por ejemplo, es magnífica, y es perfecto para saborizar platos de pescado a base de salmón y gambas. El jengibre es, además, un estupendo coadyuvante de la circulación y la digestión.');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(10, 'Cúrcuma', '94.80', , 'De color amarillo inconfundible, está en la base del curry y puede usarse para primeros platos, para saborizar carnes y para deliciosos finger food. También es conocida por sus excelentes propiedades antisépticas, y algunos estudios afirman que puede ser un alimento antitumoral.');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(11, 'Anís', '70.00', , 'Es muy apropiado para distintas elaboraciones culinarias, sopas, guisos, salsas y también repostería. Además, forma parte de la mezcla de cinco especias chinas, las que incorporan los cinco sabores de la cocina china, el dulce, el amargo, el ácido y el salado');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(12, 'Clavos de olor', '157.00', , 'Famosos por su uso en el vino caliente y en los postres. De sabor floral y levemente picante, es una especia ideal para marinar carnes y dar cuerpo a infusiones y tés. Probadlo también para ralentizar el proceso de deterioro de los alimentos: los clavos de olor, de hecho, impiden la oxidación de las grasas, responsables de que los alimentos se echen a perder. Esta especia, además, tiene excelentes magníficas digestivas.');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(13, 'Cilantro', '155.00', , 'Se usan tanto las hojas como el fruto, por lo que podréis encontrarlo en forma de hierba o de granos similares a los de la pimienta, un infaltable en vuestra despensa de especias. Los frutos, en particular, tienen un sabor casi cítrico, perfecto para sopas y salsas. El cilantro, fresco o en grano, se usa también para carnes, ensaladas y para condimentar verduras. En pequeñas dosis, como se sugiere con cualquier especia, combate la inapetencia, la hinchazón y, en general, ayuda a la digestión.');
INSERT INTO `producto` (`ID_Producto`, `Nombre`, `Precio`, `Imagen`, `Descripcion`) VALUES
(14, 'Ajenuz', '169.99', , 'Usada en la India para elaborar naan, sazonar legumbres y algunos currys. … El sabor del ajenuz recuerda a la pimienta, aunque es bastante amargo por lo que deberemos usar con moderación y preferentemente en platos que incorporen dulzor.');

